function processMove(curLoc, move) {
  switch(move) {
    case 'U':
      if (curLoc > 3) {
        return curLoc - 3;
      }
      break;
    case 'D':
      if (curLoc < 7) {
        return curLoc + 3;
      }
      break;
    case 'L':
      if ((curLoc % 3) !== 1) {
        return curLoc - 1;
      }
      break;
    case 'R':
      if ((curLoc % 3) !== 0) {
        return curLoc + 1;
      }
      break;
  }

  return curLoc;
}

function processLine(keyCodes, line) {
  const moves = line.split('');
  const lastKey = keyCodes.length ? keyCodes[keyCodes.length - 1] : 5;
  const nextKey = moves.reduce(processMove, lastKey);
  return keyCodes.concat(nextKey);
}

function processSet(moveLines) {
  return moveLines.reduce(processLine, []);
}

const keyCodes = processSet(moveString.split('\n'));
console.log(keyCodes.join(', '));
